pragma solidity >0.4.0 <0.9.0;
/**
 * @title SizeOf
 * Copyright (c) 2016-2020 zpouladzade/Seriality
 * @dev The SizeOf return the size of the solidity types in byte
 * @author pouladzade@gmail.com
 */

contract SizeOf {
    
    function sizeOfString(string memory _in) internal pure  returns(uint _size) {
        _size = bytes(_in).length / 32;
         if (bytes(_in).length % 32 != 0)
            _size++;
            
        _size++; // first 32 bytes is reserved for the size of the string     
        _size *= 32;
    }

    function getData(uint16 _data) public view returns(uint){
        return getData(_data);
    }

    function sizeOfInt(uint16 _postfix) internal pure  returns(uint size) {
        assembly{
            switch _postfix
                case 8 { size := 1 }
                case 16 { size := 2 }
                case 24 { size := 3 }
                case 32 { size := 4 }
                case 40 { size := 5 }
                case 48 { size := 6 }
                case 56 { size := 7 }
                case 64 { size := 8 }
                case 72 { size := 9 }
                case 80 { size := 10 }
                case 88 { size := 11 }
                case 96 { size := 12 }
                case 104 { size := 13 }
                case 112 { size := 14 }
                case 120 { size := 15 }
                case 128 { size := 16 }
                case 136 { size := 17 }
                case 144 { size := 18 }
                case 152 { size := 19 }
                case 160 { size := 20 }
                case 168 { size := 21 }
                case 176 { size := 22 }
                case 184 { size := 23 }
                case 192 { size := 24 }
                case 200 { size := 25 }
                case 208 { size := 26 }
                case 216 { size := 27 }
                case 224 { size := 28 }
                case 232 { size := 29 }
                case 240 { size := 30 }
                case 248 { size := 31 }
                case 256 { size := 32 }
                default  { size := 32 }
        }
    }
    
    function sizeOfUint(uint16 _postfix) internal pure  returns(uint size) {
        return sizeOfInt(_postfix);
    }

    function sizeOfAddress() internal pure  returns(uint8) {
        return 20; 
    }
    
    function sizeOfBool() internal pure  returns(uint8) {
        return 1; 
    }
}

